import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Import Routes
import Navbar from './Navbar'; 
import BusinessDataForm from './BusinessDataForm';
import BusinessInsights from './BusinessInsights';
import DeliveryAvailability from './DeliveryAvailability';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar /> 
        <Routes> {/* Wrap your Route components within Routes */}
          <Route path="/business-data-form" element={<BusinessDataForm />} />
          <Route path="/business-insights" element={<BusinessInsights />} />
          <Route path="/delivery-availability" element={<DeliveryAvailability/>} />
          {/* Add your scrollable image gallery route */}
          <Route path="/image-gallery" element={<ImageGallery />} />
        </Routes>
      </div>
    </Router>
  );
}

function ImageGallery() {
  return (
    <div className="image-container">
      {/* Include your images here */}
      <img src="./images/photo1.jpg" alt="Image 1" />
      <img src="./images/photo2.jpg" alt="Image 2" />
      <img src="./images/photo3.jpg" alt="Image 3" />
      {/* Add more images as needed */}
    </div>
  );
}

export default App;
